import React from 'react'

function Card({ data }) {
  return (
    <>
      {
        (data) ? (
          data.map(item => {
            return (
              <div className="card">
                <img src={`${item.thumbnail.path}.${item.thumbnail.extension}`} alt="" />
                <div className="title">
                  <h3>Hulk</h3>
                </div>
              </div>
            )
          })
        ) : ""
      }
    </>
  )
}

export default Card
